// import logo from './logo.svg';
import './App.css';

import React from 'react';

export default class DynamicTable extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      message: "",
      items: []
    }
  }

  render() {
    return (
      <div>
        <table>
          <thead>
            <tr>
              <th>Item</th>
              <th>Actions</th>
            </tr>
          </thead>
          {/* <tbody>

          </tbody> */}
        </table>

      </div>
    )
  }
}
